import React, { useState } from 'react';
import { Form, Button, Alert, Spinner } from 'react-bootstrap';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './LoginForm.css';

const LoginForm = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const response = await axios.post('http://localhost:3000/api/auth/signin', {
        email,
        password
      });

      localStorage.setItem('accessToken', response.data.accessToken);
      localStorage.setItem('user', JSON.stringify(response.data));
      navigate('/dashboard');
      
    } catch (err) {
      setError(err.response?.data?.message || 'Credenciales incorrectas');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-wrapper">
      <div className="login-container">
        <div className="brand-logo">
          <img src="/logo.png" alt="Logo" />
        </div>
        
        <h1 className="welcome-title">Bienvenido de vuelta</h1>
        <p className="welcome-subtitle">Ingresa tus credenciales para acceder a tu cuenta</p>

        {error && <Alert variant="danger" className="error-alert">{error}</Alert>}

        <Form onSubmit={handleSubmit} className="login-form">
          <Form.Group className="mb-3 input-field">
            <Form.Label>Correo Electrónico</Form.Label>
            <Form.Control
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="tucorreo@ejemplo.com"
              className="custom-input"
            />
          </Form.Group>

          <Form.Group className="mb-3 input-field">
            <Form.Label>Contraseña</Form.Label>
            <Form.Control
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="········"
              className="custom-input"
            />
            <a href="/forgot-password" className="forgot-password">¿Olvidaste tu contraseña?</a>
          </Form.Group>

          <Button 
            variant="primary" 
            type="submit" 
            disabled={loading}
            className="submit-button"
          >
            {loading ? (
              <Spinner as="span" animation="border" size="sm" role="status" />
            ) : 'Iniciar Sesión'}
          </Button>
        </Form>

        <div className="divider">
          <span>o</span>
        </div>

        <div className="social-login">
          <Button variant="outline-secondary" className="social-button">
            <i className="bi bi-google"></i> Google
          </Button>
          <Button variant="outline-primary" className="social-button">
            <i className="bi bi-facebook"></i> Facebook
          </Button>
        </div>

        <p className="register-link">
          ¿No tienes una cuenta? <a href="/register">Regístrate aquí</a>
        </p>
      </div>
    </div>
  );
};

export default LoginForm;
